import React, { useEffect, useState } from "react";

export default function List(props) {
  let final = {};

  return (
    <div>
      <ul>
        {props.arr.map((i) => (
          <li key={i?.id}>
            <div style={{ display: "block" }}>
              <h4
                onClick={() => {
                  final = i;
                  props.details(final);
                }}
              >
                {i?.recipeName}
              </h4>

              <button
                style={{ marginLeft: "50px" }}
                onClick={() => {
                  props.deleteObject(i?.id);
                  props.details({});
                }}
              >
                X
              </button>
              <button
                style={{ marginLeft: "50px" }}
                onClick={() => {
                  props.editable(i?.id);
                  props.details({});
                }}
              >
                Edit
              </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
